const AddStudent = ({ token }) => {
  const [classes, setClasses] = useState([]);
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    date_of_birth: '',
    gender: 'M',   // default gender
    address: '',
    parent_contact: '',
    student_class: '', // selected class id
  });

  useEffect(() => {
    if (!token) return;

    // Fetch all classes from your API endpoint
    axios.get('http://localhost:8000/api/allclassrooms/ ', {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => setClasses(res.data))
      .catch(err => {

       if (err.response) {
    // Server responded with a status other than 2xx
    console.error('Error response:', err.response.data);
    alert(`Error fetching classes: ${err.response.data.detail || JSON.stringify(err.response.data)}`);
  } else if (err.request) {
    // Request was made but no response received
    console.error('No response received:', err.request);
    alert('No response from server. Please check your network.');
  } else {
    // Something else happened in setting up the request
    console.error('Error setting up request:', err.message);
    alert('Error fetching classes: ' + err.message);
  }


      });
  }, [token]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!formData.student_class) {
      return alert("Please select a class");
    }

    try {
      await axios.post('http://localhost:8000/api/AddStudent/', formData, {
        headers: { Authorization: `Bearer ${token}` }
      });

      alert('Student profile created successfully!');
      setFormData({
        username: '',
        email: '',
        password: '',
        date_of_birth: '',
        gender: 'M',
        address: '',
        parent_contact: '',
        student_class: ''
      });
    } catch (error) {
      alert('Failed to create student: ' + JSON.stringify(error.response?.data || error.message));
    }
  };

  if (!classes.length) return <p>Loading classes...</p>;

  return (
    <form onSubmit={handleSubmit}>
      {/* other input fields */}
      <input
        name="username"
        value={formData.username}
        onChange={handleChange}
        placeholder="Username"
        required
      />
      {/* ... other inputs for email, password, etc. */}

      <label>
        Select Class:
        <select
          name="student_class"
          value={formData.student_class}
          onChange={handleChange}
          required
        >
          <option value="">-- Select Class --</option>
          {classes.map(cls => (
            <option key={cls.id} value={cls.id}>{cls.name}</option>
          ))}
        </select>
      </label>

      <button type="submit">Add Student</button>
    </form>
  );
};

export default AddStudent;
